import React from 'react';

class Start extends React.Component {
    render() {
        return (
            <div className="area">
                <h2>Współczynnik ACR (Acute to Chronic Ratio)</h2>
                <p></p>
                <PowerBtn click={props.click} />
            </div>
        )
    }
}

export default Start;
